import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (

            <header>
<center></center>
                <div id="banner">
<p style={{fontFamily: 'Comic Sans MS', fontSize:'100px'}}>Tasnim Ali</p>
</div>


<div class="menu" style={{ borderRadius: '3px', borderStyle:'dashed', borderColor: 'white', fontSize:'20px' }}>
    <ul> 
        <li style={{   display: 'inline', marginLeft: '3px' }}><a href='/'> Home </a></li>
        <li style={{   display: 'inline', marginLeft: '3px' }}><a href='/'> Archive </a></li>
        <li style={{   display: 'inline', marginLeft: '3px' }}><a href='/'> Whoami </a></li>
    </ul>
</div>

</header>

        );
    }
}








export default Header;
